#
# Structure for table "carwash"
#

DROP TABLE IF EXISTS `carwash`;
CREATE TABLE `carwash` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `number` varchar(255) DEFAULT NULL COMMENT '洗车卡号',
  `name` varchar(255) DEFAULT NULL COMMENT '姓名',
  `tel` varchar(11) DEFAULT NULL COMMENT '手机号',
  `residuedegree` int(11) DEFAULT '0' COMMENT '剩余次数',
  `time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `expdate` timestamp NULL DEFAULT '0000-00-00 00:00:00' COMMENT '到期时间',
  `douser` varchar(255) DEFAULT NULL COMMENT '操作人',
  `payment` int(11) DEFAULT '0' COMMENT '0现金1银行卡',
  `balance` double DEFAULT '0' COMMENT '第一次充值金额',
  `kind` varchar(255) DEFAULT '' COMMENT '类别',
  `carnum` varchar(255) DEFAULT '' COMMENT '车牌号',
  `models` int(11) DEFAULT '1' COMMENT '车型',
  `istrue` varchar(255) DEFAULT '1' COMMENT '0挂失1有效',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=62 DEFAULT CHARSET=utf8;

