DROP TABLE IF EXISTS `fastcarlist`;
CREATE TABLE `fastcarlist` (
  `id` int(11) NOT NULL DEFAULT '0',
  `carnum` varchar(255) DEFAULT '' COMMENT '车牌号',
  `framenum` varchar(255) DEFAULT '' COMMENT '车架号',
  `model` int(11) DEFAULT '0' COMMENT '车型',
  `mileage` int(11) DEFAULT '0' COMMENT '里程',
