  `contractaddress` varchar(255) DEFAULT '' COMMENT '承包人地址',
  `contractidentity` varchar(18) DEFAULT '' COMMENT '承包人身份证',
  `cartype` int(11) DEFAULT '0' COMMENT '车辆类型0公有1私有',
  `insurestart` timestamp NULL DEFAULT '0000-00-00 00:00:00' COMMENT '保险开始时间',
  `insureexp` timestamp NULL DEFAULT '0000-00-00 00:00:00' COMMENT '保险到期时间',
  `applicant` varchar(255) DEFAULT '' COMMENT '投保人',
  `business` double DEFAULT '0' COMMENT '商业险',
  `traffic` double DEFAULT '0' COMMENT '交强险',
  `carboat` double DEFAULT '0' COMMENT '车船险',
  `insureoffer` double DEFAULT '0' COMMENT '保险报价',
  `insurediscount` float(3,2) DEFAULT '0.00' COMMENT '保险折扣',
  `clientpay` double DEFAULT '0' COMMENT '客户支付金额',
  `insuretype` varchar(255) DEFAULT '' COMMENT '保险类型',
  `userdiscount` float(3,2) DEFAULT '0.00' COMMENT '客户折扣',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

