CREATE TABLE `purchase` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `material` varchar(255) DEFAULT '' COMMENT '物料名称',
  `specifications` varchar(255) DEFAULT '' COMMENT '规格',
  `madein` varchar(255) DEFAULT '' COMMENT '生产厂家',
